- input: "TEXT\x1CC00265850\x1C1\x1C\x1CF3A\x1CAfter a recent internal audit of Pryce
    for Congress, it was discovered that an inaccurate 2008 Year End report was inadvertently
    submitted to the FEC through our electronic filing software.  The committee had
    every intention of filing the report that is now being filed as an amendment,
    however, due to human error the wrong report was submitted through our electronic
    system.  Subsequently, the 2009 April and July quarterly reports have reflected
    inaccurate cash-on-hand amounts and those reports are being amended as well.  As
    soon as the error was discovered we took immediate action to submit an accurate
    accounting of the committee's transactions to the FEC.\n"
